description:
You are a gardener, tending to empty noise and empty space to fill them both with colour. You are a refugee, building your own world away from the spreading darkness. You are an explorer, discovering new places, new rules, and new fascinations. The universe is bigger than you know.

&quot;If I could only recommend one more game for the rest of my life, it would be Starseed Pilgrim. Imagine if Fez was all in 2D and had a super-addictive and original logic game as the main mechanic, rather than jumping and rotating. Then you basically have the flavour of it.&quot;

-----Windows Version-----
